INSERT INTO survey_player VALUES (8, 8, 0.00, 8, 1, 1, 'f', 'f', NULL, '', 25, 'mnnlich', 'wenn man immer nur die 2 Auftrge mit der Lieferzeit von 10 Tagen auswhlte konnte man einen durchgngigen Produktionsfluss erzeugen und die Kosten minimieren. Das habe ich durch die Probephase herausgefunden.
INSERT INTO survey_player VALUES (6, 6, 0.00, 6, 1, 1, 'f', 'f', NULL, '', 22, 'mnnlich', 'zu 1) 1. Versuch der Kostenminimierung, indem ich Lagerkosten und vor allem Versptungskosten vermeide
INSERT INTO survey_player VALUES (4, 4, 0.00, 4, 1, 1, 'f', 'f', NULL, '', 26, 'mnnlich', '1,1) Ich habe mich nach den Zeitraum bis zum Auslieferungsdatum bezogen und auf Grund dessen meine Entscheidungen getroffen
INSERT INTO survey_player VALUES (12, 12, 0.00, 12, 1, 1, 'f', 'f', NULL, '', 21, 'weiblich', '1. Meine Logik bezog sich auf die Kostenminimierung. Ich entschied mich jeglich fr jene AUftrge die mir keine oder nur geringe Kosten verursachten. Ich habe mich bei der Duchfhrungsphase auch weniger AUftrge konzentriert, um Kosten zu sparen.
INSERT INTO survey_player VALUES (21, 21, 0.00, 21, 1, 1, 'f', 'f', NULL, '', 28, 'mnnlich', '1.1 Nur die gerade anstehenden Produzieren lassen, da die spteren zu teuer sind.
INSERT INTO survey_player VALUES (18, 18, 0.00, 18, 1, 1, 'f', 'f', NULL, '', 24, 'weiblich', 'Ich habe die zentrale Information des Lieferdatums angewendet. Wenn eine Lieferung nicht rechtzeitig ankommt dann entstehen Kosten, so habe ich NUR die Auftrge freigegeben die die geringste Anzahl an Tagen hatten bis zu ihrem Lieferdatum, was meist den 10 Tagen entsprach.', 'BHS (berufsbildende hohere Schule)', 'Fakultt fr Betriebswirtschaft', 'Ja', 2, 6, 7, 2, 7, 6, 4, 6, 1, 6, 6, 2, 6, 7, 4, NULL, 'Ich war mir unsicher wieviele Auftrge gleichzeitig ich freigeben sollte, so habe ich nur jene freigegeben die bis zum gleichen Tag fertig produziert werden sollten.', 2, 2, 6, 6, 5, 6, 5, 'f', 'f', 'f', 't', 't', 2, 1, 1);
INSERT INTO survey_player VALUES (7, 7, 0.00, 7, 1, 1, 'f', 'f', NULL, '', 23, 'mnnlich', '1.1 Habe immer 2 Auftrge freigegeben, mit 10 Tagen Lieferzeit. Somit habe ich die Kosten auf 0 gehalten.
INSERT INTO survey_player VALUES (2, 2, 0.00, 2, 1, 1, 'f', 'f', NULL, '', 25, 'mnnlich', 'Was war wichtig und muss zuerst fertig sein. Differenz Lager - Versptung.
INSERT INTO survey_player VALUES (11, 11, 0.00, 11, 1, 1, 'f', 'f', NULL, '', 20, 'weiblich', '1. Der Auftrag, der am frhesten fertig werden musste, bekam meine Freigabe. Da jede Runde 10 Tage dauert und die Produktionsphase der meisten Auftrge 10 Tage betrgt, habe ich diese Freigabe gewhlt. So schafft man keine Lagerung, aber auch keine Versptung. 
INSERT INTO survey_player VALUES (16, 16, 0.00, 16, 1, 1, 'f', 'f', NULL, '', 23, 'weiblich', 'Auftrge mit Lieferzeit lnger als in 10 Tagen haben zu Kosten gefhrt (in Probephase), deshalb habe ich diese nicht mehr angenommen sondern lediglich diese mit "in 10 Tagen" und somit versucht keine Kosten zu verursachen', 'Universitt/Fachhochschule', 'Fakultt fr Betriebswirtschaft', 'Ja', 2, 7, 5, 4, 2, 5, 4, 3, 1, 4, 1, 6, 7, 7, 2, NULL, 'Unsicher bezglich Auftrgen die heute geliefert werden sollten - habe diese nicht mehr angenommen ', 2, 1, 3, 3, 6, 7, 7, 't', 't', 'f', 't', 't', 2, 1, 1);
INSERT INTO survey_player VALUES (15, 15, 0.00, 15, 1, 1, 'f', 'f', NULL, '', 20, 'weiblich', '1. 1 ich habe auf den Liefertermin geschaut und diese Auftrge erledigt, die in 10 Tagen geliefert werden mssen, weitere Auftrge habe ich nicht freigegeben, da diese ansonsten nur in der Warteschleife landen
INSERT INTO survey_player VALUES (5, 5, 0.00, 5, 1, 1, 'f', 'f', NULL, '', 23, 'mnnlich', 'Die verweildauer im System war durchschnittlich 6.75, also gehen sich normalerweise 2 Auftrge aus, wobei es zu keiner versptung oder wartezeit kommen sollte. Wenn also jedes mal 2 auftrge freigegeben werden sind alle zufrieden. DIe Logik wurde nicht gendert. Die Zentrale Info war eigentlich das Lieferdatum, das nicht berschritten werden sollte. ICh habe erwartet, dass es anspruchsvoller und kompliziert wird die Auftrge zu handeln aber sonst gab es keine berraschungen. Keine Probleme oder Schwierigkeiten.', 'AHS (allgemein bildende hohere Schule)', 'Fakultt fr Betriebswirtschaft', 'Ja', 8, 7, 6, 3, 5, 4, 2, 6, 4, 7, 5, 5, 7, 6, 6, NULL, 'Ob die Auftrge in gleicher weise wiederkehren oder nicht. Ich habe immer wieder kontrollier tob es sich an einem Tag um zwei Auftrge handelt oder nicht und wann der Liefertermin dazu ist-', 1, 1, 7, 7, 1, 7, 7, 'f', 'f', 'f', 't', 't', 7, 1, 1);
INSERT INTO survey_player VALUES (10, 10, 0.00, 10, 1, 1, 'f', 'f', NULL, '', 22, 'mnnlich', 'Ich habe mir die durchschnittliche Zeit im Lager angeschaut und mit den noch offenen Auftrgen verglichen, um herauszufinden, wie ich die Produktionslinien am besten freigeben kann.
INSERT INTO survey_player VALUES (3, 3, 0.00, 3, 1, 1, 'f', 'f', NULL, '', 25, 'weiblich', 'Ich habe in der Proberunde probiert, was passiert, wenn ich immer nur die ersten 2 Zeilen anklicke und da nie Kosten entstanden sind, bin ich bei dieser Strategie geblieben. berraschend war, dass es nie eine nderung gegeben hat und dass ich das Gefhl hatte, es geht nie zu Ende; ich mache immer nur dasselbe', 'Universitt/Fachhochschule', 'Fakultt fr Volkswirtschaft und Statistik', 'Ja', 4, 6, 6, 3, 4, 5, 2, 4, 3, 5, 5, 6, 6, 6, 6, NULL, 'Ich habe mich irgendwann gefragt, ob es nach Zeit geht und einfach irgendwann vorbei ist, oder ob ich eine bestimmte Menge an Auftrgen abgearbeitet haben muss. Mir sind Zweifel gekommen, ob ich etwas falsch mache, denn so einfach kann es einfach nicht sein.', 1, 1, 7, 1, 0, 7, 7, 'f', 'f', 'f', 't', 'f', 7, 1, 1);
INSERT INTO survey_player VALUES (1, 1, 0.00, 1, 1, 1, 'f', 'f', NULL, '', 19, 'weiblich', '1. 1. schauen, dass so wenig verstungen vorkommme. Daher habe ich immer geschaut ein Produkt mit schnellen Beendigungszeitraum und eines mit bisschen lngeren freizugeben. Hat am Anfang noch nicht gut  funktioniert, habe aber mit der Zeit meien Taktik verfeiert und Erfolge gesehen. Lieber waren mir Lagerkosten als Versptungskosten, weil diese sind kaum zu verhindern.
INSERT INTO survey_player VALUES (20, 20, 0.00, 20, 1, 1, 'f', 'f', NULL, '', 26, 'mnnlich', '1.1. Nach der Probephase habe ich gemerkt, dass ich eigentlich immer nur die 2 ersten Auftrge auswhlen muss um kenie Kosten entstehen zu lassen. 
INSERT INTO survey_player VALUES (19, 19, 0.00, 19, 1, 1, 'f', 'f', NULL, '', 20, 'mnnlich', 'Bei der Probephase bemerkt, dass keine Kosten anfallen wenn man bei einer durchschnittliche System Zeit von 6.75 und einem Lieferdatum in 10 Tagen, immer 2 Produkte in die Produktion lsst.
INSERT INTO survey_player VALUES (17, 17, 0.00, 17, 1, 1, 'f', 'f', NULL, '', 20, 'mnnlich', '1.1. - Habe das Prinzip versucht das Prinzip Just-in-Time anzuwenden, sodass alle Zeiten, wofr Kosten entstehen konnten gering gehalten wurden bzw. minimiert wurden.
INSERT INTO survey_player VALUES (25, 4, 0.00, 25, 2, 1, 'f', 'f', NULL, '', 21, 'weiblich', '1.1. Um die Kosten so gering wie mglich zu halten, habe ich nicht zu viele Auftrge in Bearbeitung gegeben, um die Wartezeit kosten sowie die Lagerkosten zu minimieren. 
INSERT INTO survey_player VALUES (24, 3, 0.00, 24, 2, 1, 'f', 'f', NULL, '', 21, 'mnnlich', '1.1 Ich habe nur die Auftrge freigegeben, die in der nchsten Runde gebraucht wurden, was immer 2 Auftrge waren, was durch die gegebene durchschnittliche Zeit im System mglich erschien. Diese Logik hat sich bereits in der Proberunde bewhrt.
INSERT INTO survey_player VALUES (13, 13, 0.00, 13, 1, 1, 'f', 'f', NULL, '', 25, 'weiblich', '1.Ich habe mir gedacht, dass wenn 2 Auftrge jeweils 10Tage dauern und die Zeit bis zu der nchsten Runde 10 Tage sind, ist die Maschine mit 2 Auftrgen ausgeschpft und es werden sich quasi Warteschlangen bilden, wenn ich noch einen Auftrag entgegennehme.
