INSERT INTO survey_player VALUES (32, 11, 0.00, 32, 2, 1, 'f', 'f', NULL, '', 24, 'mnnlich', 'In der Probephase habe ich gesehen, dass maximal 2 Auftrge zu Kosten von 0 fhren. Da ich auch andere Auftragslagen im Warteraum als Szenarien durchgespielt habe, konnte ich sehen, dass dies zu unerwnschten Kosten wie etwa Versptungskosten und/oder Wartekosten fhrt. Daraufhin war es fr mich klar, dass in der Durchfhrungsphase genau das erstgenannte System durchgefhrt werden muss, damit die Kosten konstant bei 0 bleiben und man sowieso immer genau 2 Auftrge in 10 Tagen beim Kunden auszuliefern hat. Ich habe meine Logik aus diesem Grund nie gendert.
