INSERT INTO survey_player VALUES (23, 2, 0.00, 23, 2, 1, 'f', 'f', NULL, '', 24, 'mnnlich', 'Ich habe mithilfe der Proberunde eine Strategie "erarbeitet". Ich habe berlegt die Logik zu ndern, da der Produktionsprozess meines Wissens nach 6,25 Tage von einem Auftrag gedauert hat. Dadurch wrden 2 Prozesse 12 Tage bentigen, eine Periode bestand aber nur aus 10 Tagen. Keine Ahnung, warum das nicht relevant wurde, aber da sich nie Kosten ergeben haben, bin ich bei meiner Strategie geblieben, immer die als nchstes auszuliefernden Auftrge zu produzieren. Vielleicht lag da aber auch ein Verstndnisfehler des Experiments auf meiner Seite vor.
