INSERT INTO survey_player VALUES (40, 19, 0.00, 40, 2, 1, 'f', 'f', NULL, '', 26, 'mnnlich', 'Mein Absicht war es die Auftrge so zeitig wie mglich fertig zustellen. Mein Autragsbuch hatte zu jeder Phase die gleiche Struktur. Alle 10 Tage erhielt ich zwei Auftrge. Bei einer durchschnittlichen Produktionszeit von 6,75 bedeutet dies fr meine Entscheidung, dass es nicht mglich ist in einer Spielperiode mehr als einen Autrag fertig zustellen. Da ich aber alle 10 Tage zwei Auftrge ausliefern musste und die Kosten fr versptete Auslieferung 15 betragen, war die gnstigste Alternative eine akutellen Auftrag, der in 10 Tagen ausgeliefert werden muss zu produzieren und einen zweiten Autrag der in 20 Tagen ausgeliefert werden muss in die Warteschlange zu geben. 
